/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<ui5-li-custom
	id="${ifDefined(context._id)}"
	class="${ifDefined(context.overflowClasses)}"
	type="${ifDefined(context.overflowState)}"
	?selected="${context.effectiveSelected}"
	?disabled="${context.effectiveDisabled}"
><div class="ui5-tab-overflow-itemContent">
		${ context.icon ? block1(context) : undefined }${ifDefined(context.text)}${ context.additionalText ? block2(context) : undefined }</div></ui5-li-custom>
`; };
const block1 = (context) => { return html`<ui5-icon name="${ifDefined(context.icon)}"></ui5-icon>
		`; };
const block2 = (context) => { return html`
			(${ifDefined(context.additionalText)})
		`; };

export default block0;
